import './App.css';
import HeaderCode from './Header';//Alias
import {Footer,FooterCode} from './Footer';//importing of name export
import  Content ,{ConentCode} from './Content';
import {Events} from './Events';

function App() {
  return (
    <div >
     <HeaderCode/>
     <Content/>
     <ConentCode/>
     <Footer/>
     <FooterCode/>
    </div>
  )
}

export default App;
